import React from 'react';
import TextField from '@material-ui/core/TextField';

import Facebook from '../../resources/images/icons/path4487.png';
import Instagram from '../../resources/images/icons/path2.png';

const styles = theme => ({
    notchedOutline: {
      borderWidth: "1px",
      borderColor: "yellow !important"
    }
  });



const Contactanos = () => {

    return (
        <div className="contactanos_wrapper">

            <div className="encabezado">Contactanos</div>
            <form>
            <TextField
                variant="outlined"
                rows="10"
                fullWidth
                InputProps={{
                  classes: {
                    notchedOutline: classes.notchedOutline
                  }
                }}
                id="standard-textarea"
                label="Input Set"
                helperText="Enter an array with elemets seperated by , or enter a JSON object"
                placeholder="Placeholder"
                multiline
                value={"" + this.props.input}
                onChange={this.props.handleChangeValue("input")}
                className={classes.textField}
                margin="normal"
              />
            </form>
            <div className="iconos">
                <br></br>
                <br></br>
                <list>

                    <a href="https://www.facebook.com/Ment-409357773178947" target="_blank">

                    <img src={Facebook} alt="foto" width='40px'/>
                    </a>

                    <a href="https://www.instagram.com/ment.soluciones" target="_blank">

                    <img src={Instagram} alt="foto" width='40px'/>
                    </a>
                </list>
            </div>
        </div>
    );
};

export default Contactanos;
